import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import {
  UserGroupIcon,
  CalendarIcon,
  UserIcon,
  PlusIcon,
} from '@heroicons/react/outline';

interface BookingStats {
  totalBookings: number;
  todayBookings: number;
  thisMonthBookings: number;
}

const DashboardOverview: React.FC = () => {
  const [stats, setStats] = useState<BookingStats>({
    totalBookings: 0,
    todayBookings: 0,
    thisMonthBookings: 0,
  });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const response = await fetch('/api/appointments/statistics/total-bookings', {
          headers: {
            'Authorization': `Bearer ${localStorage.getItem('token')}`,
          },
        });
        const data = await response.json();
        if (data.success) {
          setStats(data.data);
        }
      } catch (error) {
        console.error('Error fetching statistics:', error);
      }
    };

    fetchStats();
  }, []);

  const quickActions = [
    {
      name: 'Add Doctor',
      href: '/admin/doctors/new',
      icon: PlusIcon,
      color: 'bg-blue-500',
    },
    {
      name: 'Add Nurse',
      href: '/admin/nurses/new',
      icon: PlusIcon,
      color: 'bg-green-500',
    },
    {
      name: 'Schedule Shifts',
      href: '/admin/scheduling',
      icon: CalendarIcon,
      color: 'bg-purple-500',
    },
  ];

  return (
    <div className="space-y-6">
      <div className="grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-3">
        {/* Total Bookings Card */}
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <UserIcon className="h-6 w-6 text-gray-400" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Total Bookings</dt>
                  <dd className="text-lg font-medium text-gray-900">{stats.totalBookings}</dd>
                </dl>
              </div>
            </div>
          </div>
        </div>

        {/* Today's Bookings Card */}
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <CalendarIcon className="h-6 w-6 text-gray-400" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Today's Bookings</dt>
                  <dd className="text-lg font-medium text-gray-900">{stats.todayBookings}</dd>
                </dl>
              </div>
            </div>
          </div>
        </div>

        {/* Monthly Bookings Card */}
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <UserGroupIcon className="h-6 w-6 text-gray-400" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Monthly Bookings</dt>
                  <dd className="text-lg font-medium text-gray-900">{stats.thisMonthBookings}</dd>
                </dl>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Quick Actions */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <h3 className="text-lg font-medium leading-6 text-gray-900">Quick Actions</h3>
          <div className="mt-5 grid grid-cols-1 gap-5 sm:grid-cols-3">
            {quickActions.map((action) => (
              <Link
                key={action.name}
                to={action.href}
                className="relative group block w-full rounded-lg border-2 border-dashed border-gray-300 p-6 text-center hover:border-gray-400 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2"
              >
                <action.icon className="mx-auto h-12 w-12 text-gray-400 group-hover:text-gray-500" />
                <span className="mt-2 block text-sm font-medium text-gray-900">{action.name}</span>
              </Link>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default DashboardOverview;
